import React, { useState } from 'react';
import { useSelector } from 'react-redux';
import { selectStocksData, selectAuthor, selectCategory } from './stocksSlice';
import Moment from 'moment';
import Pagination from '@mui/material/Pagination';
import usePagination from "./pagination";
import Stack from '@mui/material/Stack';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import StraightIcon from '@mui/icons-material/Straight';
function Stocks() {
    const stocks = useSelector(selectStocksData);
    const category = useSelector(selectCategory);
    const author = useSelector(selectAuthor);
    const PER_PAGE = 5;
    const count = Math.ceil(stocks.length / PER_PAGE);
    const handleChange = (e, p) => {
        _DATA.jump(p);
    };

    const [selectedCategory, setSelectedCategory] = useState([]);
    const [selectedAuthor, setSelectedAuthor] = useState([]);
    const [selectedSort, setSelectedSort] = useState([]);

    const handleCheckboxChanged = (e) => {
        const {name, checked} = e.target;
        console.log('name ===> ', name);
        console.log('checked ===> ', checked);
        const userInput = name.split('-');
        if(userInput[0] === 'category') {
            checked ? selectCategory.push(userInput[1]) : selectCategory.splice(selectCategory.indexOf(userInput[1]), 1);
        } else if (userInput[0] === 'author') {
            checked ? selectAuthor.push(userInput[1]) : selectCategory.splice(selectCategory.indexOf(userInput[1]), 1);          
        } else {

        }
    }
    const _DATA = usePagination(stocks, PER_PAGE);
  return (
    <div>
        <div>
            <div>
                <label>Category</label>
                <div>
                    {category.length > 0 ?
                        <>
                            {category.map((c, i)=>
                                <FormControlLabel control={<Checkbox />} label={c} onChange={handleCheckboxChanged} key={i} name={'category-'+c} />
                            )}
                        </>
                    :''}
                </div>
                <label>Author</label>
                <div>
                    {author.length > 0 ?
                        <>
                            {author.map((c, i)=>
                                <FormControlLabel control={<Checkbox />} label={c} onClick={handleCheckboxChanged}  onChange={handleCheckboxChanged} key={i} name={'author-'+c} />
                            )}
                        </>
                    :''}
                </div>
                <label>Sort By</label>
                <div>
                    <div>
                        <FormControlLabel control={<Checkbox />} label='Date' name='date' onChange={handleCheckboxChanged}/>
                        <StraightIcon fontSize="small" name='date-asc'/>
                    </div>
                    <div>
                        <FormControlLabel control={<Checkbox />} label='Title' name='title' onChange={handleCheckboxChanged}/>
                        <StraightIcon fontSize="small" name='title-asc'/>
                    </div>
                </div>
            </div>
        </div>
        <div>
            {_DATA.currentData().length > 0 ? _DATA.currentData().map((data, i) => (
            <>
                <div>
                    <div>
                        <div>
                            <img alt='' src={data.url+''+data.image}/>
                        </div>
                        <div>
                            <div>
                                <label>{Moment(data.date).format('LL')}</label>
                                <label>{data.source}</label>
                            </div>
                            <div>
                                <label>{data.title}</label>
                            </div>
                        </div>
                    </div>
                    <div>
                        {data.body}
                    </div>
                    <div>
                        <label>{data.author}</label>
                    </div>
                </div>
            </>
            )): ''}
        </div>
        <div>
            <Stack spacing={2}>
                <Pagination count={count} onChange={handleChange} color="secondary"/>
            </Stack>
        </div>
    </div>
  );
}

export default Stocks;
